import React from 'react';
import './Landing.css'; // Create this file in the same folder

const Landing = () => {
  return (
    <div className="landing-container">
      <div className="image-container">
        <img
          className="background-image"
          src="/assets/landingtemple1.jpeg"
          alt="First Image"
        />
        <img
          className="background-image"
          src="/assets/landingtemple1.jpeg"
          alt="Second Image"
        />
      </div>
      {/* Add your other landing content here */}
    </div>
  );
};

export default Landing;
